观察题目可知此题考的是报错注入，右键源代码得到提升：Post发送username&password。sql语句如下：
$sql="select * from users where username='$username' and password='$password'";
注意：此处可控的参数有两个。简单手工测试，发现过滤了#，and等关键字，而且username处单独过滤了右括号，这意味着我们无法再username出使用函数，因而我们将目光转向password。经过一番人工Fuzz，发现只有exp()函数没有被过滤，故我们构造语句：exp(~(select * from(select user())a))成功爆出用户名。
